import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Typography, TableContainer, Table, TableHead, TableBody, TableRow, TableCell, Paper } from '@mui/material';

const GetTicketPage = () => {
  const [tickets, setTickets] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchTickets = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/tickets/${id}`);
        // Assuming the response.data is an array of tickets
        setTickets(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching tickets:', error);
        setLoading(false);
      }
    };

    fetchTickets();
  }, []); // Empty dependency array ensures useEffect runs once on component mount

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Ticket List
      </Typography>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>ID</TableCell>
                <TableCell>Actual Price</TableCell>
                <TableCell>Comment</TableCell>
                <TableCell>Event Venues ID</TableCell>
                <TableCell>Image URL</TableCell>
                <TableCell>Listing Price</TableCell>
                <TableCell>Lock</TableCell>
                <TableCell>Orders ID</TableCell>
                <TableCell>Seller ID</TableCell>
                <TableCell>Selling Price</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Type</TableCell>
                <TableCell>Validated On</TableCell>
                <TableCell>Verified</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {tickets.map((ticket) => (
                <TableRow key={ticket._id}>
                  <TableCell>{ticket._id}</TableCell>
                  <TableCell>{ticket.actualPrice}</TableCell>
                  <TableCell>{ticket.comment}</TableCell>
                  <TableCell>{ticket.eventVenuesID}</TableCell>
                  <TableCell>{ticket.imageURL}</TableCell>
                  <TableCell>{ticket.listingPrice}</TableCell>
                  <TableCell>{ticket.lock.toString()}</TableCell>
                  <TableCell>{ticket.ordersID}</TableCell>
                  <TableCell>{ticket.sellerID}</TableCell>
                  <TableCell>{ticket.sellingPrice}</TableCell>
                  <TableCell>{ticket.status}</TableCell>
                  <TableCell>{ticket.type}</TableCell>
                  <TableCell>{ticket.validatedOn}</TableCell>
                  <TableCell>{ticket.verified.toString()}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Container>
  );
};

export default GetTicketPage;
